-- ----------------------------
--  Table structure for `sys_org`
-- ----------------------------
DROP TABLE IF EXISTS `sys_org`;
CREATE TABLE `sys_org` (
  `id` bigint(22) NOT NULL COMMENT '组织id',
  `simple_name` varchar(30) NOT NULL,
  `full_name` varchar(200) NOT NULL COMMENT '组织名称',
  `org_id` varchar(15) DEFAULT '0' COMMENT '菜单编号 (父id+自己的设置id)',
  `pid` varchar(22) DEFAULT '0' COMMENT '父id',
  `status` tinyint(4) DEFAULT '1' COMMENT '组织状态1表示正常使用，0表示停用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人id',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新人',
  `sort_no` int(4) DEFAULT NULL COMMENT '预留字段（排序使用）',
  `level` varchar(4) DEFAULT NULL COMMENT 'level 10 总公司 11中心 12部门 13室 20 分公司 21 分公司部门',
  `remarks` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

